import React from "react";

const CurrentWeatherTempTile = () => {
    const { temp, hi, lo } = { temp: 60, hi: 62, lo: 37 };
    return (
        <div className="CurrentWeatherTempTile">
            <h1 className="current__temp">{temp}</h1>
            <h3 className="current__hi">'Hi:' {hi}</h3>
            <h3 className="current__lo">'Lo:' {lo}</h3>
        </div>
    );
};

export default CurrentWeatherTempTile;
